import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Questions(props) {

    let am = props.id;
    const q = props.getId((am) => am);


    return(
        <Paper>
            <h1>{q.title}</h1>
        </Paper>
    )
}
